import styled from 'styled-components';

const TrackSide = () => {
    return(
        <Wrapper>
            <Heading>
                Top Tracks
            </Heading>
            <ul>
                <li>#</li>
                <li>Track</li>
                <li>Sheikh</li>
            </ul>
        </Wrapper>
    )
}
const Wrapper = styled.div``
const Heading = styled.h2`
color:hsl(0, 0%, 39%);
font-size:24px;
font-weight:bold;
`
const TopBar = styled.ul`
display:flex;
gap:15px;
width:100%;
li{
    list-style:none;
    font-weight:bold;
    font-size:18px;
}
`
export default TrackSide;
